script: |
  super -f tsv -I q3609.sql | sort > q3609.out

vector: true

inputs:
  - name: q3609.sql
    data: |
      SELECT ALL + SUM ( + ( - ( - - 24 ) ) ) AS col2, - 11 FROM tab0 WHERE - - col1 * - 25 BETWEEN 99 / + col1 * - - col2 - - col0 AND col1 / + 65 * - col0 + + - 65;
  - name: tab0

outputs:
  - name: q3609.out
    data: |
      NULL	-11
